import React from "react";
import { useSelector } from "react-redux";
import './profileComponent.css';

const ProfileComponent = () => {
    const profiles = useSelector((state) => state)
    console.log(profiles)
    return (
        <div className="card"> 
            <div className="avatar">
            <img src="./avatar.svg" alt="avatar" className="profile__image"/>
            </div>
            <div className="profileinfo">
            <div className="profile__name"> Jigyashu </div>
            <div className="profile__email"> Jigyashu@ </div>
            <div className="profile__title"> Hello </div>
            <div className="profile__detail">
                1200 Followers    
            </div> 
            </div>
            <div>
                <button className="likePost">Like</button>
                <button className="editPost">Edit</button>
                <button className="deletePost">Delete</button>
            </div>
        </div> 
    );
};


export default ProfileComponent;
